import React from "react";
import Data from "./Data";
import Items from "./Items";

const Home = () => {
  return (
    <>
      <div className="container nav_bg">
        <div className="row">
          <div className="col-10 mx-auto"></div>
        </div>
      </div>
      <Items />
    </>
  );
};

export default Home;
